<!DOCTYPE html>
<html>

<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width = device-width, initial-scale = 1.0, maximum-scale = 1.0">
    <style>
        html {
            background-color: black;
        }

        .screen {
            display: flex;
            width: 100%;
            height: 100%;
            position: absolute;
            margin: auto;
            top: 0;
            bottom: 0;
            left: 0;
            right: 0;
        }

        .img {
            width: 100%;
            height: 100%;
            position: absolute;
            object-fit: contain;
        }

        .controls {
            position: relative;
            aspect-ratio: 9 / 16;
            max-width: 100%;
            max-height: 100%;
            height: calc(100vw / 9 * 16);
            margin: auto;
        }

        .btn {
            position: absolute;
            display: flex;
            -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
        }

        .helpHerBtn {
            top: 72%;
            left: 9%;
            width: 85%;
            height: 14%;
        }

        .topBtn {
            top: 26%;
            left: 64%;
            width: 31%;
            height: 24%;
        }

        .botBtn {
            top: 53%;
            left: 64%;
            width: 31%;
            height: 24%;
        }

        .finalBtn {
            width: 100%;
            height: 100%;
        }

        #chooseMakeup {
            display: none;
        }

        #blackMakeup {
            display: none;
        }

        #brownMakeup {
            display: none;
        }

        #blackFinal {
            display: none;
        }

        #brownFinal {
            display: none;
        }
    </style>
    <script src="mraid.js"></script>
</head>

    <script>
        "use strict"

        function shift(from, to) {
            hide(from);
            show(to);
        }

        function hide(x) {
            let y = document.getElementById(x);
            y.style.display = "none";
        }

        function show(y) {
            let x = document.getElementById(y)
            x.style.display = "flex";
        }

        function showNextQuiz() {
            if (document.getElementById("blackMakeup").style.display === "flex") {
                setTimeout(shift, 1500, "blackMakeup", "blackFinal");
            } else if (document.getElementById("brownMakeup").style.display === "flex") {
                setTimeout(shift, 1500, "brownMakeup", "brownFinal");
            }
        }

        //function from: https://stackoverflow.com/questions/21741841/detecting-ios-android-operating-system
        function getMobileOperatingSystem() {
            var userAgent = navigator.userAgent || navigator.vendor || window.opera;

            // Windows Phone must come first because its UA also contains "Android"
            if (/windows phone/i.test(userAgent)) {
                return "Windows Phone";
            }

            if (/android/i.test(userAgent)) {
                return "Android";
            }

            // iOS detection from: http://stackoverflow.com/a/9039885/177710
            if (/iPad|iPhone|iPod/.test(userAgent) && !window.MSStream) {

                return "iOS";
            }

            return "unknown";
        }

        function goToStore() {
            if (getMobileOperatingSystem() === "iOS") {
                goToAppStore();
            } else {
                goToPlayStore();
            }
        }

        function goToAppStore() {
            goToUrl("https://apps.apple.com/ua/app/suitsme-luxury-dress-up-game/id1536929374?l=eng");
        }

        function goToPlayStore() {
            goToUrl("https://play.google.com/store/apps/details?id=com.style.fashion.game.suitsme");
        }

        function goToUrl(url) {
            if (typeof mraid !== 'undefined') {
                mraid.open(url);
            } else {
                location.href = url;
            }
        }
